(5330, 5029, 'Tú', 3, '0908413825', '', 'Chưa Biết', '- hôm qua trang có gọi cho chị, thì trang cũng lên tham khảo trang web bên mình.<br>\r\n- Thì không biết Bên mình thiết kế web lâu chưa chị.<br>\r\n- 1 Năm thì công nghệ nó cũng lỗi thời rồi đó chị, hiện tại bây giờ website dược thiết kế theo công nghệ HTML 5, là công nghệ mới nhất bây giờ, giao diện đẹp, hỗ trợ Ipad, Iphone, Vì em nghĩ đa số khách hàng bên mình có thu nhập trung bình khá trở lên, thì khi đó, khách hàng của chị sẽ dễ dàng tìm sản phẩm của chị hơn.<br>\r\n- bên cạnh đó thì bên website bên Trang được viết bằng code PHP, ưu điểm lớn nhất là độ bảo mật rất là cao, dễ dàng thay đổi màu sắc, giao diện nữa.<br>\r\n- Còn website mà viết theo công nghệ cũ, thì thường là độ bảo mật sẽ không cao, được viết bằng joomla, Mẫu này được copy trên mạng nên có thể đăng nhập Admin.<br>\r\n- Và chỉ tìm hiểu sơ về kĩ thuật, cần vài thao tác đơn giản là có thể xóa được trang web bên chị.<br>\r\n- Thì khi đó sẽ rất tốn nhiều chi phí của chị đã đầu tư vào nó, và đồng thời những thông tin của chị sẽ bị xóa mất.<br>\r\n- Thì bên Trang, thiết kế web dựa trên nền công nghệ mới nhất bây giờ đó là HTML5, bên cạnh đó còn viết code bằng PHP nên rất dễ dàng thay đổi giao diện và màu sắc, ưu điểm lớn nhất là bảo mật rất là cao.<br>\r\n- Hỗ trợ Seo URL, nên rất thân thiện với Google'),
