(7472, 6875, 'Nhựt', 0, '0917890608', 'cinelandcafe@gmail.com', 'Chưa Biết', '- Đăng kí tên miền, chưa thiết kế WS.<br>\r\n- Tên miền trỏ vào facebook.<br>\r\n- Quán cafe HD.<br>\r\n- WS thì đưa thông tin, thực đơn cũng như hình ảnh không gian quán.<br>\r\n- Đặc biệt quán cafe bên mình có chiếu phim HD, thì anh có thể cập nhật thời gian chiếu, nội dung phim, Straler phim cho khách hàng cập nhật tốt hơn.<br>\r\n- Ko gian quán nhỏ, có phòng xem phim HD, 1h giá 75k, tiền nước riêng.'),
